import React from "react";
import { SEO } from "components/seo";

type Props = {
  deviceType?: {
    mobile: boolean;
    tablet: boolean;
    desktop: boolean;
  };
};

const ProfilePage: React.FC<Props> = ({ deviceType }) => {
  return (
    <>
      <SEO title="Profile - E-NOVA" description="Profile Details" />
    </>
  );
};

export default ProfilePage;
